import React from 'react';
import styled from 'styled-components';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';


const Container = styled.div`
    display: flex;
`;

// Designing the left side of the container.. 
const Left = styled.div`
    flex: 1;
`;

const Logo = styled.div``;

const Desc = styled.div``;

const SocialContainer = styled.div``;

const SocialIcons = styled.div``;

const Center = styled.div`
    flex: 1;
`;

const Right = styled.div`
    flex: 1;
`;


export default function Footer() {
  return (

    <Container>
        {/* Designing the Left side of the Footer.. */}
        <Left>
            <Logo>CATE.</Logo>
            <Desc>Mollit eu laboris occaecat amet aliquip sunt. Duis do laboris est culpa irure. Velit est do consequat nostrud duis pariatur.</Desc>
            <SocialContainer>

                <SocialIcons>
                    <FacebookIcon />
                </SocialIcons>

                <SocialIcons>
                    <InstagramIcon />
                </SocialIcons>

                <SocialIcons>
                    <FacebookOutlinedIcon />
                </SocialIcons>

                <SocialIcons>
                    <FacebookOutlinedIcon />
                </SocialIcons>

            </SocialContainer>
        </Left>

        {/* Designing the Center side of the Footer.. */}
        <Center></Center>

        {/* Designing the Right side of the Footer.. */}
        <Right></Right>
    </Container>

  )
}
